configure:
  commands:
    end:
      new_state: execute
    ip nat inside source list test4 interface Loopback100 overload: "ip nat inside\
      \ source list test4 interface Loopback100 overload\r\n"
    ip nat inside source list test4 interface Loopback100: "ip nat inside\
      \ source list test4 interface Loopback100\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
  prompt: stack3-nyquist-1(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: stack3-nyquist-1(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: stack3-nyquist-1#
